Winstep Nexus Ultimate 18.8.0.1118 !{Latest}

Winstep Nexus Ultimate&#xA0;is a compact, convenient and beautiful panel for quickly launching programs and opening documents (files, folders) in the style of a panel of a similar purpose in Mac OS.&#xA0;Supports a lot of skins, the choice of sound design.&#xA0;A flexible system of settings and the Russian interface will not leave you indifferent to this program.&#xA0;

Differences from the free version:

The ability to create as many docks as you like
Ability to create multi-level mini-docks (for example, for grouping certain applications into a separate mini-dock)
Panel with tabs - there you can push the Control Panel, Desktop icons, etc.
In the near future, many more exclusive features

Features RePack&apos;a:&#xA0;
Type:&#xA0;installation.&#xA0;
Languages:&#xA0;ML.&#xA0;
Cut:&#xA0;English and German help.&#xA0;
Activation:&#xA0;done (block with firewall, do not update).&#xA0;
Command-line switches:
&#x2022; Silent installation of the regular version: / S&#xA0;
&#x2022; You can also select the directory to install: After all keys, add / D =% path% Example: setup_file.exe / S / D = C:  Winstep

OS:&#xA0;XP / Vista / 7 / 8.1 / 10.

